create table Census1 (
	census_year VARCHAR(4),
	household_id INT,
	family_name VARCHAR(50),
	parent1_first_name VARCHAR(50),
	parent1_date_of_birth DATE,
	parent1_gender VARCHAR(4),
	parent2_first_name VARCHAR(50),
	parent2_date_of_birth DATE,
	parent2_gender VARCHAR(6),
	child_name VARCHAR(50),
	child_date_of_birth DATE,
	child_gender VARCHAR(50),
	address VARCHAR(50),
	province VARCHAR(3),
	phone_number VARCHAR(50),
	household_income VARCHAR(50)
);
